 Based on the given univariate statistics and bivariate correlations, I will generate 25 new data points by varying target_material and target_thickness while scaling pulse_width and energy accordingly. Then, I'll adjust spot_size, intensity, and power to calculate cutoff_energy.

First, let's define a list of unique target_materials and a range for target_thickness:

```python
target_materials = ['aluminium', 'gold', 'plastic'] * 8 + ['copper'] * 4
target_thickness_range = (0.1, 2.5)
```

Now, let's define functions to calculate pulse_width, energy, spot_size, intensity, power, and cutoff_energy based on the given statistics and correlations:

```python
import random

def generate_pulse_width(target_thickness):
    return round(random.uniform(24, 12900), 2)

def generate_energy(target_thickness, energy_mean=13.9, energy_variance=2350, correlation_pe_tt=0.25):
    return round(energy_mean + random.gauss(0, np.sqrt(energy_variance)) * (target_thickness / 1.02), 2)

def generate_spot_size():
    return round(random.uniform(2.13, 60), 2)

def generate_intensity(energy):
    return round(1e20 + random.gauss(0, np.sqrt(3.96e41)) * energy, 2e18)

def generate_power(intensity, energy):
    return round(intensity * energy, 2)

def generate_cutoff_energy(energy):
    return round(energy + random.gauss(0, np.sqrt(156)) * 0.672, 1)

np.random.seed(42)  # for reproducibility
```

Finally, let's generate the 25 new data points:

```python
new_data = []
for _ in range(25):
    target_material = random.choice(target_materials)
    target_thickness = random.uniform(*target_thickness_range)
    pulse_width = generate_pulse_width(target_thickness)
    energy = generate_energy(target_thickness)
    spot_size = generate_spot_size()
    intensity = generate_intensity(energy)
    power = generate_power(intensity, energy)
    cutoff_energy = generate_cutoff_energy(energy)
    new_data.append([target_material, target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy])
print(new_data)
```

This should output 25 new data points with the given features according to the specified conditions.

